import React, { Component } from 'react';
import axios from 'axios';

export default class Appointment extends Component {
  constructor(props) {
    super(props);

    this.onChangeUsername = this.onChangeUsername.bind(this);
    this.onSubmit = this.onSubmit.bind(this);

    this.state = {
      username: ''
    }
  }

  onChangeUsername(e) {
    this.setState({
      username: e.target.value
    })
  }

  onSubmit(e) {
    e.preventDefault();

    const user = {
      username: this.state.username
    }

    console.log(user);

    axios.post('http://localhost:5000/users/add', user)
      .then(res => console.log(res.data));

    this.setState({
      username: ''
    })
  }

  render() {
    return (
      <div className="jumbotron .text-warning " style={{backgroundColor:"red" }}>
        <img src="images/hospital.png" className="img-rounded" alt="Cinque Terre" style={{blockSize:"130px",marginLeft:"280px" }}/><br/>
        <h style={{marginLeft:"150px" ,fontSize:"30px"}} className=" text-white">BOOK APPOINTMENT</h>
        <form onSubmit={this.onSubmit}>
          <div className="form-group"> 
            <label>First Name: </label>
            <input  type="text"
                required
                className="form-control"
                value={this.state.username}
                onChange={this.onChangeUsername}
                />
          </div>
          <div className="form-group"> 
            <label>Last Name: </label>
            <input  type="text"
                required
                className="form-control"
                value={this.state.username}
                onChange={this.onChangeUsername}
                />
          </div>
          <div className="form-group"> 
            <label>Age: </label>
            <input  type="number"
                required
                className="form-control"
                value={this.state.username}
                onChange={this.onChangeUsername}
                />
          </div>
          <div className="form-group"> 
            <label>Gender: </label>
            <select className="browser-default custom-select">
                            <option>Choose your option</option>
                             <option required
                className="form-control"
                value={this.state.username}
                onChange={this.onChangeUsername}>Male</option>
                            <option required
                className="form-control"
                value={this.state.username}
                onChange={this.onChangeUsername}>Female</option>
                            <option required
                className="form-control"
                value={this.state.username}
                onChange={this.onChangeUsername}>Others</option>


                 </select>

          </div>
          <div className="form-group">
          <label>Phone Number:: </label>

            <input  type="number"
                required
                className="form-control"
                value={this.state.username}
                onChange={this.onChangeUsername}
                />
                </div>
          <div className="form-group">
            <input type="submit" value="Create User" className="btn btn-primary" />
          </div>
        </form>
      </div>
    )
  }
}
